    private Driver CurrentUser;

    private string message;
    private int id;
    private string username;
    private string password;
    private string firstname;
    private string secondname;
    private string birthday;
    private string sex;
    private string numberplate;

    private bool show = true;
    private bool showEdit;

    IUserServices client = new UserServices();

    private void Initialize()
    {
        CurrentUser = ((UserAuthenticationStateProvider) AuthenticationStateProvider).GetUser();
        id = CurrentUser.id;
        username = CurrentUser.username;
        password = CurrentUser.password;
        firstname = CurrentUser.firstname;
        secondname = CurrentUser.secondname;
        birthday = CurrentUser.birthday;
        sex = CurrentUser.sex;
        numberplate = CurrentUser.numberPlate;
    }
    
    private void ChangeGender(ChangeEventArgs args)
    {
        CurrentUser.sex = null;
        try
        {
            CurrentUser.sex = args.Value.ToString();
        }
        catch (Exception e){}
        
    }

    private void SaveEdit()
    {
        try
        {
            CurrentUser = ((UserAuthenticationStateProvider) AuthenticationStateProvider).EditUser(CurrentUser);
            message = "Change saved!";
            Thread.Sleep(1000);
            Initialize();
            Thread.Sleep(1000);
            CancelEdit();
            Show();
        }
        catch (Exception e)
        {
            message = e.Message;
        }
    }

    private void Show()
    {
        show = true;
    }

    private void Hidden()
    {
        show = false;
    }

    private void ShowEdit()
    {
        showEdit = true;
    }

    private void CancelEdit()
    {
        showEdit = false;
    }

